import { Component } from '@angular/core';

import { CameraProvider } from '../../providers/util/camera.provider';
import { NavController,
		     Platform,
 		     ActionSheetController,
	       LoadingController} from 'ionic-angular';

import { micoskinService } from '../../providers/micoskin-service';


@Component({
  selector: 'page-home',
  templateUrl: 'home.html'
})
export class HomePage {

  chosenPicture: string;
  chosenPicture2: Array<{category:string, percent:any}> = [];

  type: string;
  imageData = "data:image/jpeg;base64,"

  constructor(public navCtrl: NavController,

  	public actionsheetCtrl: ActionSheetController,
    public cameraProvider: CameraProvider,
    public micoskin: micoskinService,
    public platform: Platform,
    public loadingCtrl: LoadingController) {

    this.type = "principal"
    
  }

   changeSearch(){
    this.type = "search"
   }

   changeDiagnostico() {
    this.type = "diagnostico"
   }

   changePrincipal() {
    this.type= "principal"
   }

   changePicture() {

    const actionsheet = this.actionsheetCtrl.create({
      title: 'Subir imagen',
      buttons: [
        {
          text: 'Camara',
          icon: !this.platform.is('ios') ? 'camera' : null,
          handler: () => {
            this.takePicture();
            this.type = "load";
          }
        },
        {
          text: !this.platform.is('ios') ? 'Galeria' : 'camera roll',
          icon: !this.platform.is('ios') ? 'image' : null,
          handler: () => {
            this.getPicture();
            this.type = "load";
          }
        },
        {
          text: 'Cerrar',
          icon: !this.platform.is('ios') ? 'close' : null,
          role: 'destructive',
          handler: () => {
            console.log('the user has cancelled the interaction.');
          }
        }
      ]
    });
    return actionsheet.present();
  }

  takePicture() {
    const loading = this.loadingCtrl.create();

    loading.present();
    return this.cameraProvider.getPictureFromCamera().then(picture => {
      if (picture) {
        this.chosenPicture = picture;
        //this.imageData.image64 = picture;
      }
      loading.dismiss();
    }, error => {
      alert(error);
    });
  }

  getPicture() {
    const loading = this.loadingCtrl.create();

    loading.present();
    return this.cameraProvider.getPictureFromPhotoLibrary().then(picture => {
      if (picture) {
        this.chosenPicture = picture;
        //this.imageData.image64 = picture;

      }
      loading.dismiss();

    }, error => {
      alert(error);
    });
  }

  loadStats(jsonData) {
  var data = jsonData;
  if (data["success"] == true) {
    for (var category in data['confidence']) {
      var percent = Math.round(parseFloat(data["confidence"][category]) * 100);
      console.log(category)
      console.log(percent)
      this.chosenPicture2.push({category:category,percent:percent})
    
    }
   }
  }

  getAccuracy() {
    const loading = this.loadingCtrl.create();

    loading.present();
    return this.micoskin.Classify(this.chosenPicture).then(data => {
      if (data) {
      //this.chosenPicture = picture;
      this.loadStats(data)
      console.log(this.chosenPicture2[0])
      this.type="search"
      }
      loading.dismiss();

    }, error => {
      console.log("what?")
      alert(error);
    });
  }

  

}
